static inline float processSample (float x) noexcept {
    const float ax = std::fabs(x);
    if (ax <= kT0) return x;

    float a = ax;
    if (a > kXMax) a = kXMax;
    float t = (a - kT0) * kInvDx;
    int i = (int) t;
    if (i < 0) i = 0;
    if (i >= kLutSize - 1) i = kLutSize - 2;
    const float frac = t - (float) i;
    const float y0 = kLut[i];
    const float y1 = kLut[i + 1];
    const float y  = y0 + (y1 - y0) * frac;
    return std::copysign(y, x);
}

